import React from 'react';
import './panel.css';
class Panel extends React.Component
{
	settings()
	{
	}
	signOut()
	{
		
	}
	render()
	{
		return <div id = "panel">		
			<i className = "fa fa-gear" onClick = {this.settings}></i>
			<i className = "fa fa-sign-out" onClick = {this.signOut}></i>
		
		</div>
	}
}

export default Panel;
